/*Table structure for table `t_siuakb` */

DROP TABLE IF EXISTS `t_siuakb`;

CREATE TABLE `t_siuakb` (
  `no_urut` int(10) NOT NULL,
  `no_daftar` int(10) DEFAULT NULL,
  `no_sk` varchar(50) DEFAULT NULL,
  `ket` varchar(3) DEFAULT NULL,
  `guna` varchar(30) DEFAULT NULL,
  `nama_pemilik` varchar(50) DEFAULT NULL,
  `alamat_pemilik` text,
  `id_kec_pemilik` varchar(21) DEFAULT NULL,
  `id_kel_pemilik` varchar(30) DEFAULT NULL,
  `nama_perusahaan` varchar(100) DEFAULT NULL,
  `jenis_usaha` varchar(30) DEFAULT NULL,
  `alamat_perusahaan` text,
  `id_kec_perusahaan` varchar(21) DEFAULT NULL,
  `id_kel_perusahaan` varchar(30) DEFAULT NULL,
  `npwp` varchar(50) DEFAULT NULL,
  `npwpd_npwrd` varchar(50) DEFAULT NULL,
  `jumlah_kendaraan` int(11) DEFAULT NULL,
  `tanggal_daftar` date DEFAULT NULL,
  `tanggal_terbit` date DEFAULT NULL,
  `tanggal_perpanjangan` date DEFAULT NULL,
  `no_sk_lalu` varchar(50) DEFAULT NULL,
  `status_berlaku` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`no_urut`)
